import React from "react";
import { Row } from "reactstrap";

export default function index() {
  return (
    <>
      <Row>
        <Row className="laptophideCustomdropdown match-height mt-0 mb-1">
          <Col className="widthdate" xl="12" md="12" xs="12">
            <CustomDropDown />
          </Col>
        </Row>
      </Row>
    </>
  );
}
